    /**
     * @return {?}
     */
    saveGroup() {
        if (!this.groupTitle) {
            this.validGroupTitle = false;
            return;
        }
        /** @type {?} */
        const helpExtend = window && ((/** @type {?} */ (window))).helpExtend;
        /** @type {?} */
        const userIds = [];
        this.selections.forEach((/**
         * @param {?} selection
         * @return {?}
         */
        selection => {
            userIds.push(selection[this.idField]);
        }));
        /** @type {?} */
        const body = {
            title: this.groupTitle,
            description: this.groupNote,
            userIds,
            type: 1
        };
        if (this.editingGroupId) {
            body.id = this.editingGroupId;
            body.type = 3;
            delete body.userIds;
        }
        if (helpExtend) {
            helpExtend.curdGroupData(body).then((/**
             * @param {?} data
             * @return {?}
             */
            data => {
                this.showGroupDialog = false;
                this.groupTitle = null;
                this.groupNote = null;
                this.editingGroupId = null;
                this.groupComponent.assembleData();
            }));
        }
        else {
            throw new Error(this.localeService.getValue("personnelSelector.message.groupExtend"));
        }
    }
