    /**
     * @private
     * @param {?} arr
     * @return {?}
     */
    sortArray(arr) {
        if (arr.length === 0) {
            return arr;
        }
        arr = arr.sort((/**
         * @param {?} a
         * @param {?} b
         * @return {?}
         */
        (a, b) => {
            return Number(a.layer) - Number(b.layer);
        }));
        return arr;
    }
    /**
     * @private
     * @param {?} arr
     * @return {?}
     */
    assembleOrgFullPath(arr) {
        /** @type {?} */
        const sortedArr = this.sortArray(arr);
        /** @type {?} */
        let path = sortedArr.reduce((/**
         * @param {?} pre
         * @param {?} cur
         * @param {?} index
         * @return {?}
         */
        (pre, cur, index) => {
            return pre + '_' + cur.name;
        }), '');
        path = path.substring(1);
        return path;
    }
    // 初始化显示那些tab页签
    /**
     * @private
     * @return {?}
     */
    initDisplayTab() {
        if (this.enableRecentContacts && this.allTabIds.indexOf(this.recentTabId) === -1) {
            /** @type {?} */
            const recent = !!this.allTabIds ? ',recent' : 'recent';
            this.allTabIds += recent;
        }
        if (this.unSelectedUserIds && this.allTabIds.indexOf(this.candidateTabId) === -1) {
            /** @type {?} */
            const candidate = !!this.allTabIds ? ',candidate' : 'candidate';
            this.allTabIds += candidate;
        }
        if (this.unSelectedUserIds) {
            /** @type {?} */
            const allTabIds = this.allTabIds.split(',');
            allTabIds.forEach((/**
             * @param {?} item
             * @param {?} index
             * @return {?}
             */
            (item, index) => {
                if (item === this.organizationTabId || item === this.sysUserGroupTabId) {
                    allTabIds.splice(index, 1);
                }
            }));
            this.allTabIds = allTabIds.join(',');
        }
        if (this.enableMyGroup && this.allTabIds.indexOf(this.groupTabId) === -1) {
            /** @type {?} */
            const group = !!this.allTabIds ? ',group' : 'group';
            this.allTabIds += group;
        }
        if (this.showTabIds) {
            this.allTabIds = this.showTabIds;
        }
        // 兼容老表单
        if (!this.favoritesTool) {
            /** @type {?} */
            const oldArr = this.allTabIds.split(',').filter((/**
             * @param {?} item
             * @return {?}
             */
            item => item !== this.recentTabId && item !== this.favoritesTabId));
            this.allTabIds = oldArr.join(',');
        }
        if (this.allTabIds.indexOf(this.favoritesTabId) === -1) {
            this.enableFavorites = false;
        }
        if (this.allTabIds.indexOf(this.recentTabId) === -1) {
            this.enableRecentContacts = false;
        }
        else {
            this.enableRecentContacts = true;
        }
    }
    // 由ngOnInit()调用
