    /**
     * 预处理组织数据
     * @private
     * @param {?} data
     * @param {?} userPath
     * @return {?}
     */
    dealData(data, userPath) {
        /** @type {?} */
        const userPathList = [];
        if (!userPath) {
            return [];
        }
        /** @type {?} */
        let maxLength = userPath.length / 4;
        // todo 分层加载
        if (this.enableHierarchicalLoading) {
            maxLength = maxLength - 1;
        }
        for (let a = 0; a < maxLength; a++) {
            userPathList.push({ path: userPath.substring(0, 4 * (a + 1)) });
        }
        /** @type {?} */
        const newDatas = [];
        /** @type {?} */
        const nodes = new Map();
        if (data.length) {
            data.forEach((/**
             * @param {?} item
             * @return {?}
             */
            item => {
                /** @type {?} */
                const path = item['path'];
                /** @type {?} */
                let parentPath;
                if (this.onlyCurrentAdminOrg) {
                    parentPath = path == this.currentAdminOrgPath ? 'top' : item.path.slice(0, -4);
                }
                else {
                    parentPath = item['layer'] == '1' ? 'top' : item.path.slice(0, -4);
                }
                if (!nodes[path]) {
                    nodes[path] = { children: [] };
                }
                nodes[path] = {
                    data: {
                        id: item.id,
                        name: this.orgNameType == 'total' ? item.name : (item.abbreviation ? item.abbreviation : item.name),
                        path: item.path,
                        layer: Number(item.layer)
                    },
                    expanded: false,
                    children: nodes[path]['children']
                };
                if (this._isInArray(item.path, 'path', userPathList)) {
                    nodes[path]['expanded'] = true;
                }
                else {
                    nodes[path]['expanded'] = false;
                    // todo 分层加载需要
                    if (this.enableHierarchicalLoading && !item.isDetail) {
                        nodes[path]['leaf'] = false;
                    }
                }
                if (parentPath == 'top') {
                    newDatas.push(nodes[path]);
                }
                else {
                    if (!nodes[parentPath]) {
                        nodes[parentPath] = { children: [] };
                    }
                    ((/** @type {?} */ (nodes[parentPath]['children']))).push(nodes[path]);
                }
            }));
        }
        return newDatas;
    }
