    // searchResultComponent存在时被调用，用于根据全局搜索筛选框内的文本（编号/姓名/首字母）进行人员搜索
    /**
     * @private
     * @param {?=} size
     * @param {?=} token
     * @return {?}
     */
    unifiedSearch(size, token) {
        if (!this.searchText) {
            return;
        }
        if (token) {
            this.searchResultComponent.pageIndex = 1;
        }
        // 适配工作流人员场景开始
        /** @type {?} */
        const showTabIds = this.showTabIds.split(this.multipleChoiceSeparator);
        /** @type {?} */
        const pageIndex = size && size.pageIndex ? size.pageIndex : this.pageIndex;
        if (showTabIds.length === 1 && showTabIds[0] === this.candidateTabId) {
            /** @type {?} */
            const candidateItems = this.candidateItems.filter((/**
             * @param {?} item
             * @return {?}
             */
            item => {
                return item.code.indexOf(this.searchText) !== -1 || item.name.indexOf(this.searchText) !== -1;
            }));
            /** @type {?} */
            const start = (pageIndex - 1) * this.pageSize;
            /** @type {?} */
            const end = start + this.pageSize;
            /** @type {?} */
            const result = candidateItems.slice(start, end);
            this.hideSearchPanel = false;
            this.searchResultComponent.selections = this.selections;
            this.searchResult = result;
            this.searchResultComponent.itemTotalCount = result.length;
            this.searchResultComponent.pageTotal = Math.ceil(result.length / this.pageSize);
            if (this.searchResultComponent.pageTotal === 0) {
                this.searchResultComponent.pageTotal = 1;
            }
            return;
        }
        // 适配工作流人员场景结束
        // const requestParam: any = {
        //     pageSize: this.pageSize,
        //     pageIndex: pageIndex,
        //     withAllOrg: this.enableChildHierarchy ? 1 : 0,
        //     notGetStopUser: !this.includeStopUser,
        //     notGetCurrentUser: !this.includeCurrentUser,
        //     orderField: this.personnelOrderField,
        //     userTypeMode: this.userTypeMode,
        //     filterId: this.filterId
        // };
        // if(!!this.shownOrgId && this.shownOrgId !== '*'){
        //     requestParam.orgId = this.shownOrgId;
        // }
        // if(this.withPermission) {
        //     requestParam.withPermission = true;
        //     requestParam.authOp = 'UserManage';
        // }
        /** @type {?} */
        let queryFilter = {
            filters: [
                {
                    'FilterField': 'name',
                    'Value': this.searchText,
                    'Compare': CompareType.Like,
                    'Relation': RelationType.And,
                    'Expresstype': ValueType.Value
                },
                {
                    'FilterField': 'state_isEnabled',
                    'Value': '1',
                    'Compare': CompareType.Equal,
                    'Relation': RelationType.Empty,
                    'Expresstype': ValueType.Value
                }
            ],
            sortorders: [
                {
                    'SortField': 'displayOrder',
                    'SortType': 0 /*0升序，1降序，默认0*/
                }
            ],
            needHeader: false,
            inCurrentOrg: this.onlyCurrentAdminOrg
        };
        if (this.includeStopUser) {
            queryFilter.filters = [{
                    'FilterField': 'name',
                    'Value': this.searchText,
                    'Compare': CompareType.Like,
                    'Relation': RelationType.Empty,
                    'Expresstype': ValueType.Value
                }];
        }
        this.apiService.getUsersWithFilter(queryFilter).subscribe((/**
         * @param {?} res
         * @return {?}
         */
        (res) => {
            this.hideSearchPanel = false;
            this.searchResultComponent.selections = this.selections;
            res.forEach((/**
             * @param {?} item
             * @return {?}
             */
            item => {
                /** @type {?} */
                const targetOrg = this.allAdminOrgData.find((/**
                 * @param {?} data
                 * @return {?}
                 */
                data => data.id == item.belongingOrg.id));
                if (targetOrg) {
                    /** @type {?} */
                    const parentNodes = [targetOrg];
                    this.getOrgALLPath(this.allAdminOrgData, targetOrg, parentNodes);
                    /** @type {?} */
                    const orgAllPathArr = this.assembleOrgFullPath(parentNodes).split('_');
                    item['orgAllPath'] = Array.from(new Set(orgAllPathArr)).join('_');
                    item['orgAllPath'] = item['orgAllPath'] ? item['orgAllPath'] : item.belongingOrg.name;
                }
                else {
                    item['orgAllPath'] = item.belongingOrg.name;
                }
            }));
            this.searchResult = res ? res : [];
            this.searchResult = this.searchResult.slice(this.pageSize * (pageIndex - 1), this.pageSize * pageIndex);
            this.searchResultComponent.itemTotalCount = res.length;
            this.searchResultComponent.pageTotal = Math.ceil(res.length / this.pageSize);
            if (this.searchResultComponent.pageTotal === 0) {
                this.searchResultComponent.pageTotal = 1;
            }
        }));
    }
