    /**
     * input框标签删除逻辑 todo 强依赖用户编号唯一
     * @param {?} item
     * @param {?} event
     * @return {?}
     */
    onRemoveSelectItem(item, event) {
        /** @type {?} */
        const currentIndex = this.finalText.findIndex((/**
         * @param {?} text
         * @return {?}
         */
        text => text === item));
        this.finalText.splice(currentIndex, 1);
        /** @type {?} */
        let currentItem;
        this.selections.forEach((/**
         * @param {?} selection
         * @param {?} index
         * @return {?}
         */
        (selection, index) => {
            if (index === currentIndex) {
                currentItem = selection;
                this.selections.splice(index, 1);
            }
        }));
        this.cloneSelections = cloneDeep(this.selections);
        this.componentMap.forEach((/**
         * @param {?} component
         * @param {?} key
         * @param {?} map
         * @return {?}
         */
        (component, key, map) => {
            component.selections = cloneDeep(this.selections);
            component.cloneSelections = cloneDeep(this.selections);
            component.userIds = '';
            component.cloneUserIds = '';
            if (!!currentItem) {
                component.cancelSelections({ id: currentItem['id'] });
            }
        }));
        // 关联或udt先出非主键的
        this.onModelChange(this.finalText.join());
        this.onModelTouched(this.finalText.join());
        this.tagRemoved.emit({
            deleteItem: item,
            deleteIndex: currentIndex,
            selections: this.selections
        });
        if (this.enableQuick) {
            this.setQuickContainerWidth();
        }
        event.stopPropagation();
        event.cancelBubble = true;
    }
