    // 打开人员选择弹窗
    /**
     * @return {?}
     */
    farrisDialogshow() {
        if ((!!this.userIds && this.userIds.includes(',') && !this.multiSelect) || (this.selections.length > 1 && !this.multiSelect)) {
            this.msgService.show('warning', this.localeService.getValue("personnelSelector.message.multiSelect"), {
                height: 140,
                showHeader: false
            });
            return;
        }
        if (!this.hasSetGlobalConfigParam) {
            /** @type {?} */
            const param = {
                withDisabledOrg: this.includeStopOrg,
                gettingCurrentOrg: false,
                onlyDisplayOrg: false
            };
            /** @type {?} */
            const getAllAdminOrgData$ = this.apiService.getOrganizations(param);
            /** @type {?} */
            const requestUrl = '/api/runtime/sys/v1.0/personnel-selector-param';
            /** @type {?} */
            const getgetGlobalParam$ = this.apiService.getGlobalParamConfig(requestUrl);
            getAllAdminOrgData$.pipe(switchMap((/**
             * @param {?} resData
             * @return {?}
             */
            (resData) => {
                if (resData && resData.orgs) {
                    this.allAdminOrgData = resData.orgs;
                    return getgetGlobalParam$.pipe(tap((/**
                     * @param {?} res
                     * @return {?}
                     */
                    (res) => {
                        res['success'] && this.setGlobalConfigParam(res);
                        this.hasSetGlobalConfigParam = true;
                        this.showPersonnelSelectorDialog();
                    })));
                }
            }))).subscribe();
        }
        else {
            this.showPersonnelSelectorDialog();
        }
    }
