    /**
     * @private
     * @return {?}
     */
    showPersonnelSelectorDialog() {
        this.checkDisplayTab();
        //this.setInputGroupElementWith();
        this.cdRef.detectChanges();
        this.quickPanelVisible = false;
        this.searchText = null;
        this.hideSearchPanel = true;
        this.farrisDialog.show();
        this.initComponentMap();
        this.setParamInChildComponent();
        this.checkSelectionsIncludeCode();
        if (this.initLoadTreeData === true) {
            // 初始化是否过滤领导
            this.initGroupLeaderStatus();
            // 初始化是否显示指定组织
            if (!!this.orgId && this.orgId !== '*') {
                this.globalSearch = false;
            }
            if (this.unSelectDatagrid) {
                this.unSelectDatagrid.cdRef = this.injector.get(ChangeDetectorRef);
            }
            if (this.sysUserGroupUnselect) {
                this.sysUserGroupUnselect.cdRef = this.injector.get(ChangeDetectorRef);
            }
            // 是否分层加载
            if (this.enableHierarchicalLoading) {
                this.showTabIds.includes(this.organizationTabId) && this.hlAssembleTreeData();
                this.showTabIds.includes(this.sysUserGroupTabId) && this.hlAssembleSysUserGroupTreeData();
            }
            else {
                this.showTabIds.includes(this.organizationTabId) && this.assembleTreeData();
                this.showTabIds.includes(this.sysUserGroupTabId) && this.assembleSysUserGroupTreeData();
            }
            if (this.activeTabId !== this.organizationTabId && this.activeTabId !== this.sysUserGroupTabId) {
                // 初次打开选人组件时，当前tab页不为组织架构或者用户分组，也需要加载人员数据
                this.initFavorites();
                this.datagridLoad();
            }
        }
        else {
            this.initFavorites();
            this.datagridLoad();
        }
        this.initLoadTreeData = false;
        this.showUserDetailInfo || this.mapFields2Component();
        //this.mapFields2Component();
        this.adjustModalDialogSize();
    }
    /**
     * @private
     * @return {?}
     */
