    // 同步各个子组件的已选人员
    /**
     * @private
     * @return {?}
     */
    synchronizeSelections() {
        if (this.unSelectDatagrid) {
            this.unSelectDatagrid.selections = cloneDeep(this.selections);
            this.unSelectDatagrid.cloneSelections = cloneDeep(this.selections);
            this.unSelectDatagrid.userIds = this.userIds;
            this.unSelectDatagrid.cloneUserIds = this.userIds;
        }
        if (this.sysUserGroupUnselect) {
            this.sysUserGroupUnselect.selections = cloneDeep(this.selections);
            this.sysUserGroupUnselect.cloneSelections = cloneDeep(this.selections);
            this.sysUserGroupUnselect.userIds = this.userIds;
            this.sysUserGroupUnselect.cloneUserIds = this.userIds;
        }
        if (this.candidateDatagrid) {
            this.candidateDatagrid.selections = cloneDeep(this.selections);
            this.candidateDatagrid.cloneSelections = cloneDeep(this.selections);
            this.candidateDatagrid.userIds = this.userIds;
            this.candidateDatagrid.cloneUserIds = this.userIds;
        }
        if (this.recentContactsComponent) {
            this.recentContactsComponent.selections = cloneDeep(this.selections);
            this.recentContactsComponent.cloneSelections = cloneDeep(this.selections);
            this.recentContactsComponent.userIds = this.userIds;
            this.recentContactsComponent.cloneUserIds = this.userIds;
        }
        if (this.favoritesComponent) {
            this.favoritesComponent.selections = cloneDeep(this.selections);
            this.favoritesComponent.cloneSelections = cloneDeep(this.selections);
            this.favoritesComponent.userIds = this.userIds;
            this.favoritesComponent.cloneUserIds = this.userIds;
        }
        if (this.groupComponent) {
            this.groupComponent.selections = cloneDeep(this.selections);
            this.groupComponent.cloneSelections = cloneDeep(this.selections);
            this.groupComponent.userIds = this.userIds;
            this.groupComponent.cloneUserIds = this.userIds;
        }
        // 如果表单映射会组件，则不需要重新组装finalText
        if (!this.mapFields) {
            this.assembleFinalText();
        }
    }
    // 根据传入的userIds获取期望已选的人员数据，并同步至当前组件和各个子组件
    // 被调用之处：ngOnChanges()、mapFields2Component()
    /**
     * @private
     * @param {?} ids
     * @return {?}
     */
    assembleDataByUserId(ids) {
        if (!ids) {
            if (!!this.mapFields) {
                this.selections = [];
                this.selections = this.selections.slice();
                this.cloneSelections = cloneDeep(this.selections);
            }
            this.synchronizeSelections();
            return;
        }
        this.apiService.getUsersById(ids).subscribe((/**
         * @param {?} result
         * @return {?}
         */
        (result) => {
            if (!!this.mapFields) {
                this.selections = [];
            }
            result.forEach((/**
             * @param {?} res
             * @return {?}
             */
            res => {
                /** @type {?} */
                const targetUser = this.selections.find((/**
                 * @param {?} data
                 * @return {?}
                 */
                data => data['id'] == res['id']));
                if (!targetUser) {
                    res.displayName = !!this.showUserCode ? ('[' + res.code + ']' + res.name) : res.name;
                    res.popoverContext = Object.assign({}, {
                        $implicit: {
                            'name': res.name,
                            'code': res.code,
                            'contactInfo': res.contactInfo,
                            'belongOrg': res.belongingOrg.name
                        }
                    });
                    this.selections.push(res);
                }
            }));
            this.selections = this.selections.slice();
            this.cloneSelections = cloneDeep(this.selections);
            this.synchronizeSelections();
        }));
    }
    // 处理字段映射，打开人员选择弹窗时被调用
    /**
     * @private
     * @return {?}
     */
    mapFields2Component() {
        if (!this.mapFields) {
            return;
        }
        // const helpFields = Object.keys(this.mapFields);
        // if (!helpFields.includes(this.idField)) {
        //     this.notifyService.warning(this.localeService.getValue("personnelSelector.message.mapFields"));
        //     return;
        // }
        if (this.ngControl &&
            this.ngControl.formDirective &&
            this.ngControl.formDirective.form &&
            this.ngControl.formDirective.form.bindingData) {
            /** @type {?} */
            const bindingData = this.ngControl.formDirective.form.bindingData;
            if (bindingData.setValue) {
                /** @type {?} */
                const bindingPath = this.ngControl.formDirective.form.bindingPath;
                /** @type {?} */
                let pathArr = [];
                if (bindingPath) {
                    pathArr = bindingPath.split('/').filter((/**
                     * @param {?} n
                     * @return {?}
                     */
                    n => n !== ''));
                }
                /** @type {?} */
                const multiPath = this.mapFields['id'].split(this.multipleChoiceSeparator);
                /** @type {?} */
                const fieldPaths = pathArr.concat(multiPath[0].split('.'));
                /** @type {?} */
                const ids = bindingData.getValue(fieldPaths);
                if (ids === undefined || ids === null) {
                    return;
                }
                else {
                    this.initUserDetailInfo = true;
                    this.assembleDataByUserId(ids);
                }
            }
        }
    }
