    // 分层加载用户分组树时，需要二次处理接口返回的数据，只保留当前节点和它的直接上级，剔除上级的同级
    /**
     * @private
     * @param {?} array
     * @param {?} node
     * @param {?} resArray
     * @return {?}
     */
    getFilterSysUserGroupData(array, node, resArray) {
        /** @type {?} */
        const parents = array.filter((/**
         * @param {?} item
         * @return {?}
         */
        item => {
            return Number(item.layer) === (Number(node.layer) - 1);
        }));
        if (!parents) {
            return;
        }
        for (const item of parents) {
            if (item.id === node.parentId || node.parentId === '') {
                item.selectable = false;
                resArray.push(item);
                this.getFilterSysUserGroupData(array, item, resArray);
                break;
            }
        }
    }
